import { NavLink } from 'react-router-dom';


function Navbar() {
    return (
        <nav className="navbar navbar-expand-lg navbar-light bg-transparent">
            <div className="container">
                <NavLink to="/" ><img width="120" src="https://res.cloudinary.com/getapet/image/upload/v1617641641/Logo_get_a_pet_qgclol.png" alt="getapet"/></NavLink>
                <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#main-navbar" aria-controls="main-navbar" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
                <ul className="d-flex">
                    <li><NavLink to="/about"/>About Us</li>
                    <li><NavLink to="/pets"/>Pets</li>
                    <li><NavLink to="/shelters"/>Shelters</li>
                </ul>
            </div>
        </nav>
    );
}

export default Navbar
